<!DOCTYPE html>
<html>
<head><style type="text/css">
      html,
      body {
        margin: 0;
        padding: 0;
        height: 100vh;
      }
      body {
        display: flex;
        align-items: center;
        padding: 0;
        margin: 0;
        background-color: #e6e6e6;
        overflow: hidden;
      }
      .slide {
        text-align: center;
      }
      .slide svg {
        border: 1px solid #c8c6c4;
      }
      .menu-container {
        width: 300px;
        border-right: 1px solid #bfbfbf;
        height: 100%;
        overflow: auto;
      }
      .menu-container ul {
        list-style: decimal;
        padding: 0 40px;
        color: #6b6b6b;
      }
      .menu-container ul li {
        height: 150px;
        margin: 20px 0;
      }
      .menu-container .slide svg {
        width: 200px;
        height: 150px;
        cursor: pointer;
      }

      .slide-container {
        flex: auto;
      }

      .slide-container .slide {
        display: none;
      }
      .slide-container .slide svg {
        max-height: 95vh;
      }
      body > div.icon > i {
        width: 50px;
        height: 50px;
        display: inline-block;
        border-top: 1px solid #424242;
        border-left: 1px solid #424242;
        cursor: pointer;
        user-select: none;
      }
      body > div.icon {
        width: 100px;
        text-align: center;
      }

      body > div.prev i {
        transform: rotate(-45deg);
      }
      body > div.next i {
        transform: rotate(135deg);
      }
</style>
<script lang="javascript">
  var currentId = ''
  window.onload = function() {
    var slideContainer = document.createElement('div')
    slideContainer.className = 'slide-container'
    var slides = document.querySelectorAll('div.slide')
    const queryString = new URLSearchParams(document.location.search)
    if (queryString.get('mode') === 'play') {
      slides.forEach(function (slide) {
        var svg = slide.children[0]
        svg.removeAttribute('width')
        svg.removeAttribute('height')
        slideContainer.append(slide)
      })
      var prevBtn = document.createElement('div')
      var prevBtni = document.createElement('i')
      var nextBtn = document.createElement('div')
      var nextBtni = document.createElement('i')
      nextBtn.className = 'icon next'
      prevBtn.className = ' icon prev'
      var cb = function(mode) {
        var oldDom = document.getElementById(currentId)
        oldDom.style.display = 'block'
        oldDom.style.width = '0'
        oldDom.style.height = '0'
        var currentDom
        if (mode === 'next') {
          currentDom = oldDom.nextElementSibling;
          if (!currentDom) currentDom = slideContainer.children[0];
        } else {
          currentDom = oldDom.previousElementSibling
          if (!currentDom) currentDom = slideContainer.children[slideContainer.children.length - 1];
        }
        currentDom.style.display = 'block'
        currentDom.style.width = 'unset'
        currentDom.style.height = 'unset'
        currentId = currentDom.id
      }
      prevBtni.addEventListener('click', function() {
        cb('prev')
      })
      nextBtni.addEventListener('click', function() {
        cb('next')
      })
      prevBtn.append(prevBtni)
      nextBtn.append(nextBtni)
      document.body.append(prevBtn)
      document.body.append(slideContainer)
      document.body.append(nextBtn)
    } else {
      // 构建左边菜单
      slideContainer.addEventListener('mousewheel', (event) => {
          let nextIdIndex = 0
          const slideArr = [...slides]
          const currentPic = slideArr.find(slide => slide.id == currentId)
          if (event.deltaY < 0) {
            document.getElementById(currentId).style.display = 'none'
            nextIdIndex = slideArr.indexOf(currentPic) == 0 ? 0 : slideArr.indexOf(currentPic) - 1
            slides[nextIdIndex].style.display = 'block'
            currentId = slides[nextIdIndex].id
          }
          else if (event.deltaY > 0) {
            document.getElementById(currentId).style.display = 'none'
            nextIdIndex = slideArr.indexOf(currentPic) == slides.length - 1 ? slides.length - 1 : slideArr.indexOf(currentPic) - -1
            slides[nextIdIndex].style.display = 'block'
            currentId = slides[nextIdIndex].id
          }
       });
      var menuContainer = document.createElement('div')
      menuContainer.className = 'menu-container'
      var items = document.createElement('ul')
      slides.forEach(function (slide) {
        var svg = slide.children[0]
        svg.removeAttribute('width')
        svg.removeAttribute('height')
        var item = document.createElement('li')
        var clone = slide.cloneNode(true)
        clone.id = 'menu-item-' + clone.id
        clone.addEventListener('click', function(ev) {
          document.getElementById(currentId).style.display = 'none';
          slide.style.display = 'block'
          currentId = slide.id;
        })
        item.append(clone)
        slideContainer.append(slide)
        items.append(item)
      })
      menuContainer.append(items)
      document.body.append(menuContainer)
      document.body.append(slideContainer)
    }
    slides[0].style.display = 'block'
    currentId = slides[0].id
   }
   window.addEventListener('message', (e) => {
     if (e.data == 'zoomIn') {
       if (!document.body.style.zoom) document.body.style.zoom = 1.25
       else if (document.body.style.zoom < 2) document.body.style.zoom -= -0.25
     } else if (e.data == 'zoomOut') {
       if (!document.body.style.zoom) document.body.style.zoom = 0.75
       else if (document.body.style.zoom > 0.25) document.body.style.zoom -= 0.25
     }
   })
 </script>
